import React from 'react'
import {render} from 'react-dom'

const mystyle = {
	textAlign: 'center',
	fontSize: '20px'
}

class Component extends React.component
{
	render ()
	{
		var text = 'Class component';
		return 
		(
			<div>
				<p> { text } </p>
			</div>
		);
	}
}

function Hello ()
{
	return (
		<div>
			<p style={mystyle}> Hello world </p>
			{Getname()}
		</div>
	)
}
function Getname ()
{
	return (
		<div>
			<p style={mystyle}> Hello {prompt("Print name", "root")} </p>
		</div>
	)
}

render(<Hello />, document.getElementById("root"));
